import React from 'react';

function Card({country}) {
    return (
      <li className="card">
          <img src={country.flags.svg} alt={country.name.common} />
          <div className="datacontener">
              <ul>
                  <li>{country.name.common}</li>
                  <li>{country.capital}</li>
                  <li>{country.population}</li>
              </ul>
          </div>
      </li>
    );
}

export default Card;
